  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:41.352432\",\n\t\"name\": \"narrative-report-big-stone-wetland-management-district-calendar-year-1972\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Big Stone
  WMD outlines District accomplishments during the 1972 calendar year. The report
  begins by summarizing the weather conditions, habitat conditions, water conditions,
  and food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, mammals, and
  fish- is also covered. The development and maintenance section discusses physical
  developments, plantings, and vegetation control. Resource management is outlined;
  topics include fur harvesting. The public relations section of the report describes
  recreational uses, hunting, and violations. Items of interest, N-R forms, and photographs
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
